import { NavLink, Outlet } from "react-router-dom";
import { getDiplomas } from "../api";

export default function Diplomas() {
  const list = getDiplomas();

  return (
    <section className="split">
      <div className="panel left">
        <h2 className="section-title">Diplomas</h2>

        <div className="list">
          {list.map((d) => (
            <NavLink key={d.id} to={d.id} className="item">
              <div className="item-top">
                <span className="pill">{d.id}</span>
                <span className="count">{d.modulesCount} modules</span>
              </div>
              <div className="item-title">{d.name}</div>
              <div className="item-desc">{d.description}</div>
            </NavLink>
          ))}
        </div>
      </div>

      <div className="panel right">
        <Outlet />
      </div>
    </section>
  );
}
